import React from 'react';
import styled from 'styled-components';

const BoxforEcPick=styled.div`
    width:408px;
    height:306px;
    background: #FFFFFF 0% 0% no-repeat padding-box;
    opacity: 1;
`;

function EcPickBox(){
    return <BoxforEcPick />;
}

export default EcPickBox;
